package sar;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int num=30;
switch (num) {
case 10:
    System.out.println("ten");
break;
case 20:
	System.out.println("twenty");
	break;
case 30:
	System.out.println("thirty");
	break;
	default:
		System.out.println("Infinite");
	
	
}
	}

}
